value.value:
{
  testData = all(`test.transient:CSVFile`);
  file = $testData[2].get(`test.transient:CSVFile#file`);
  parsed = $file.parseCSV(trimSpaces:true, 
    parsers: {
      "Datum": x-> dateFormat("dd.MM.yy").format(dateFormat("dd.MM.yyy").parse($x)), 
      "Name": y -> toUpperCase($y),
      "Differenz": z -> numberFormat("#0.00").parse($z),
      "Integer": w -> numberFormat("#").parse($w)+1
      });
  $parsed
}
